import "zeppelin-solidity/contracts/token/ERC20/BasicToken.sol";

contract UpCoin{
    string  public name = "Upcoda Tocken";
    string  public symbol = "UPCT";
    uint  public decimal = 18;
    uint256 public totalSupply;
    address owner;
    uint256 public _initialSupply = 1000000 * (10 ** decimal);
    event Transfer(
    address indexed _from,
    address indexed _to,
    uint256 _value
    );

    event Approval(
    address indexed _owner,
    address indexed _spender,
    uint256 _value
    );

    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    function UpCoin () public {
        owner = msg.sender;
        balanceOf[msg.sender] = _initialSupply;
        totalSupply = _initialSupply;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value);

        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;

        emit Transfer(msg.sender, _to, _value);

        return true;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;

        emit Approval(msg.sender, _spender, _value);

        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceOf[_from]);
        require(_value <= allowance[_from][msg.sender]);

        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;

        allowance[_from][msg.sender] -= _value;

        emit Transfer(_from, _to, _value);

        return true;
    }
    function() payable public {
        sendTokens();
    }

    function sendTokens() payable public  {
        require(msg.value > 0);

        uint tokensBought = msg.value;
        balanceOf[msg.sender] += tokensBought;
        balanceOf[owner] -= tokensBought;
        require(this.transfer(msg.sender, tokensBought));
        emit Transfer(this, msg.sender, msg.value);
    }
}
